package com.fishercoder;


import _459.Solution1;
import _459.Solution2;
import _459.Solution3;
import junit.framework.TestCase;
import org.junit.Test;


/**
 * Created by stevesun on 6/6/17.
 */
public class _459Test {
    private static Solution1 solution1;

    private static Solution2 solution2;

    private static Solution3 solution3;

    @Test
    public void test1() {
        TestCase.assertEquals(true, _459Test.solution1.repeatedSubstringPattern("abab"));
        TestCase.assertEquals(true, _459Test.solution2.repeatedSubstringPattern("abab"));
        TestCase.assertEquals(true, _459Test.solution3.repeatedSubstringPattern("abab"));
    }

    @Test
    public void test2() {
        TestCase.assertEquals(false, _459Test.solution1.repeatedSubstringPattern("aba"));
        TestCase.assertEquals(false, _459Test.solution2.repeatedSubstringPattern("aba"));
        TestCase.assertEquals(false, _459Test.solution3.repeatedSubstringPattern("aba"));
    }

    @Test
    public void test3() {
        TestCase.assertEquals(false, _459Test.solution1.repeatedSubstringPattern("a"));
        TestCase.assertEquals(false, _459Test.solution2.repeatedSubstringPattern("a"));
        TestCase.assertEquals(false, _459Test.solution3.repeatedSubstringPattern("a"));
    }

    @Test
    public void test4() {
        TestCase.assertEquals(false, _459Test.solution1.repeatedSubstringPattern(""));
        TestCase.assertEquals(false, _459Test.solution2.repeatedSubstringPattern(""));
        TestCase.assertEquals(false, _459Test.solution3.repeatedSubstringPattern(""));
    }

    @Test
    public void test5() {
        TestCase.assertEquals(true, _459Test.solution1.repeatedSubstringPattern("ababab"));
        TestCase.assertEquals(true, _459Test.solution2.repeatedSubstringPattern("ababab"));
        TestCase.assertEquals(true, _459Test.solution3.repeatedSubstringPattern("ababab"));
    }

    @Test
    public void test6() {
        TestCase.assertEquals(false, _459Test.solution1.repeatedSubstringPattern("abababc"));
        TestCase.assertEquals(false, _459Test.solution2.repeatedSubstringPattern("abababc"));
        TestCase.assertEquals(false, _459Test.solution3.repeatedSubstringPattern("abababc"));
    }

    @Test
    public void test7() {
        TestCase.assertEquals(false, _459Test.solution1.repeatedSubstringPattern("abababaaba"));
        TestCase.assertEquals(false, _459Test.solution2.repeatedSubstringPattern("abababaaba"));
        TestCase.assertEquals(false, _459Test.solution3.repeatedSubstringPattern("abababaaba"));
    }
}

